import axios from 'axios'
export const addAccount = (data) => {
  const newData = data;
  return (dispatch) => {
    axios("http://localhost:3000/api/v1/accounts", {
      headers: {
        "Contet-Type": "application/json",
        "Accept": "application/json",
      },
      method: "POST",
      body: JSON.stringify(newData),
    });
  };
};
